import React, { useEffect, useState } from 'react';
import axios from 'axios';
import styles from './SuperAdminDashboard.module.css';

const SuperAdminDashboard = () => {
  const [stats, setStats] = useState({});
  const [delayedRequests, setDelayedRequests] = useState([]);
  const [viewDelayed, setViewDelayed] = useState(false);

  useEffect(() => {
    axios.get('http://localhost:8080/api/superadmin/dashboard')
      .then(res => setStats(res.data))
      .catch(err => console.error(err));
  }, []);

  const handleViewDelayed = () => {
    axios.get('http://localhost:8080/api/superadmin/reports/delayed')
      .then(res => {
        setDelayedRequests(res.data);
        setViewDelayed(true);
      })
      .catch(err => console.error(err));
  };

  return (
    <div className={styles.dashboard}>
      <h2>Super Admin Dashboard</h2>
      <div className={styles.cards}>
        <div className={styles.card}>Total Requests: {stats.totalRequests}</div>
        <div className={styles.card}>Completed: {stats.completedRequests}</div>
        <div className={styles.card}>Pending: {stats.pendingRequests}</div>
        <div className={styles.card}>Delayed: {stats.delayedRequests}</div>
        <div className={styles.card}>Residents: {stats.totalResidents}</div>
      </div>

      <button onClick={handleViewDelayed} className={styles.button}>View Delayed Requests</button>

      {viewDelayed && (
        <div className={styles.delayedSection}>
          <h3>Delayed Requests</h3>
          <ul>
            {delayedRequests.map((req, index) => (
              <li key={index}>
                #{req.requestId} - {req.description} - Expected: {req.exceptCompletion}
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
};

export default SuperAdminDashboard;
